INSERT INTO `blogs` (`id`, `thumbnail`, `title`, `description`, `tags`, `views`, `if_hide_cmt`, `time`) VALUES
(64, '2021-03-25_07-03_11pm_news-image-9.jpg', 'INTERCLAN TOURNAMENT 2020 FINAL', '<p>Genocide interclan tournaments 2020 Final BELIEVERS VS 420. Finally the Team BELIEVERS wins. The first round and the second round were drawn. Finally, the organizers returned a mr 12 mach unit. There were Team BELIEVERS 13 and Team 420 11 available. By that score, Genocide interclan COD4 tournament Team BELIEVERS won.</p>', 'INTERCLAN, TOURNAMENT', 37, 1, '2020-04-09 01:08:58'),
(65, '2021-03-25_07-05_31pm_1-a.jpg', 'VALORANT RECRUITS NEW MEMBERS TO THE GAME', '<p>New members to the valorant game Recruitment these days. You too can join our gaming team. Come to our TeamSpeak3 server and contact an admin. (TS3 :- gncesports.lk) He will tell more details. Come and join us. Genocide e-Sports</p>', 'VALORANT, NEW_MEMBERS', 30, 1, '2020-07-27 19:51:08'),
(66, '2021-03-25_07-07_01pm_118176673_1019150241851167_6046545936208846985_o.jpg', 'TEAMSPEAK-3 LAST VERSION 3.12.1', '<p>Heartfelt thanks to everyone who supported getting the \"Activation License\". We appreciate the trust you have placed in us. You can now connect to our TeamSpeak Server via gncesport.lk / gnclk</p>', 'TEAMSPEAK-3, LAST_VERSION', 48, 1, '2020-11-29 13:49:39'),
(67, '2021-03-25_07-09_15pm_gnc_new_cod4server_20201129.jpg', 'NOW YOU CAN JOIN WITH OUR NEW COD4 SERVER', '<p>COD4-IP :- connect snd.gncesports.lk TEAMSPEAK SERVER :- gncesports.lk OR gnclk OFFICIAL WEBSITE :- <a href=\"../\">https://gncesports.lk/</a></p>\r\n<p><img src=\"../images/blogs/genocide_2021-03-26_12-30_57pm_teamspeak.png\" alt=\"\" width=\"300\" height=\"300\" /></p>', 'COD4_SERVER, ESPORTS_V7_COD4_SERVER, COD4_SERVER', 92, 1, '2020-11-29 15:33:57'),
