(69, '2021-04-13_03-43_05pm_2021-03-31_09-57_36am_tecka.png', 'CONGRATULATIONS TECHNIC', '<p>We are a clan member of GNC || TECHNIC today the rank of valorant competitive is immortal !!. We wish you to reach the radiant rank</p>\r\n<p>CONGRATULATIONS !!!</p>\r\n<p><img src=\"../images/blogs/genocide_2021-04-13_03-42_43pm_tec.jpg\" alt=\"\" width=\"723\" height=\"406\" /></p>', 'CONGRATULATION,  VALORANT,  IMMORTAL_VALORANT', 200, 1, '2021-03-31 04:22:10'),
(70, '2021-03-31_10-25_17am_167098557_1174792986286891_987156791906948747_n.jpg', 'GnC Xtream Inside - InHouse Tournament Season 02', '<p>Genocide is all set to host our annual <strong>\'GnC Xtream Inside - InHouse Tournament Season 02\'</strong> this year as well. We invite you to join us.</p>\r\n<p><img src=\"../images/blogs/genocide_2021-03-31_10-30_24am_teamspeak cover orginal2.jpg\" alt=\"\" width=\"507\" height=\"185\" /></p>\r\n<p>There is no set date for this yet. However, this will take place in <strong>mid-April 2021</strong>. We will let you know the date soon</p>', 'INTERCLAN, TOURNAMENT_2021', 186, 1, '2021-03-31 04:55:17'),
(71, '2021-04-12_02-51_20pm_wiing-prize-main-post-orginal.jpg', 'GNC Extream Inside Inhouse Tournament Season 2 COD4', '<p>The winning team of the GNC Extream Inside Inhouse Tournament Season 2 COD4 will receive a cash prize of 2,500.</p>', 'GNC_Extream, Tournament', 63, 1, '2021-04-12 09:21:20'),
