(1, 'http://localhost/github/genocide-run', '2021-03-25_08-44_37am_fav.png', '2021-03-25_07-24_36am_logo.png', '2021-03-25_08-34_58am_textlogo.png', '2021-03-25_08-46_36am_textlogo.png', 'Genocide e-Sports Sri Lanka', '<!--script-->', '<!--script-->\r\n', 'alexlanka@gmail.com', 'alexlanka@gmail.com', 'alexlanka99@gmail.com', '+947712345678', '+947712345678', '#', 'https://www.facebook.com/GenocideEsportsOfficial', 'https://www.youtube.com/channel/UC1zToEDjjFwG1613gEz8k9Q', 'https://twitter.com/GenocideeSport2', 'The easiest way you can contact us is through our teamspeak 3 server. Our teamspeak server is gncesports.lk. Send a message to our facebook page \"Genocide E-Sports Sri Lanka\". If not, https://gncesports.lk/contact have a form. You can fill out the form and submit.', 'gncesports, Colombo 7', 'Genocide e-Sports is Sri lanka multiplayer gaming clan, players of any age and skill level, competitive team-based sports always have the unique opportunity to experience a pro-athlete atmosphere.', '404', '404', '2021 Genocide eSports All Rights Reserved', '2020-11-17 13:18:57');
