INSERT INTO `our_story` (`id`, `right_img`, `title`, `subtitle`, `link`, `story`, `history`, `today`, `if_hide`) VALUES
(1, '2021-03-25_05-46_32pm_story-bg.jpg', 'we are Genocide, Have fun', 'ABOUT GENOCIDE', 'https://gncesports.lk/about', 'Genocide eSports 2018 started with 15 people. Our clan of Genocide eSports was led by Vidusara or NOSTALGIA. We played the COD4 game at the beginning of the clan', 'After Genocide started with the 2018 COD4 game, we also played games like Apex Legends, DOTA in the clan. Genocide, which started with 12 people, had around 30 members by 2020.', 'By 2021 this year we will be playing a lot of games like COD4, DOTA, APEX LEGENDS, RAINBOW 6 SIEGE, VALORANT. Genocide currently has a total of 65 members.', 1);
